/* custom document ready */


$(document).ready(function () {
    prettyPrint();

    /* Header */
    if (document.documentElement.clientWidth > 1024) {
        $('#nav-wrap').removeClass('navbar-fixed-top');
    }
    switchHeader();
    $(window).scroll(function () {
        $('#nav-wrap').addClass('navbar-fixed-top');
        switchHeader();
    });

    /* Page Scroll */
    $('body.home header a[href = "/"]').click(function () {
        $('html, body').animate({ scrollTop: 0 }, 300, 'easeInOutCirc');
        return false;
    });
    $('header .nav a').click(function () {
        var anchor = $(this).attr('href');
        $('html, body').animate({ scrollTop: $(anchor).offset().top }, 300, 'easeInOutCirc');
        return false;
    });


    $('.expand .show').click(function (e) {
        e.preventDefault();
        var obj = $(this).parents('.expand');
        var html = $(this).html();


        if ($(obj).hasClass('expanded')) {
            $(obj).removeClass('expanded');
            $('.code-sample', obj).slideUp(100);
            $('.details-list', obj).slideUp(100);



            html = html.replace("Hide", "Show").replace("minus", "plus");

        }
        else {

            html = html.replace("Show", "Hide").replace("plus", "minus");

            $(obj).addClass('expanded');
            $('.code-sample', obj).slideDown(400);
            $('.details-list', obj).slideDown(400);
            //$(this).html('<i class="icon-minus-sign"></i> Hide example');
        }

        $(this).html(html);
    });



});

function switchHeader() {
    if (document.documentElement.clientWidth > 1024) {
        if ($(window).scrollTop() <= 100) {
            $('#nav-wrap').removeClass('navbar-fixed-top');
        }
    }
}

